#analyzes the Genetic Algorithm data and prints the average of the good weights
def analyzeData(goodVars):
	tempGoodVars = []
	count = 0
	for list2D in goodVars:
		for element in list2D:
			if (element[2] >= 0): 
				count += 1
				tempGoodVars.append(element)
	(goodCols, goodHoles, goodGaps, goodClear) = (0,0,0,0)
	for element in tempGoodVars:
		goodCols += element[0]
		goodHoles += element[1]
		goodGaps += element[2]
		goodClear += element[3]
	goodCols /= len(tempGoodVars)
	goodHoles /= len(tempGoodVars)
	goodGaps /= len(tempGoodVars)
	goodClear /= len(tempGoodVars)
	print("cols", goodCols)
	print("holes", goodHoles)
	print("gaps", goodGaps)
	print("clear", goodClear)
	print("count", count)

